    <td>{btcInfo[0]}</td>
    <td>{btcInfo[1]}</td>
    <td>{btcInfo[2]}</td>
  </tr>
  <tr>
    <td>Eve</td>
    <td>Jackson</td>
    <td>94</td>
  </tr>
</table> 
    </div>
};

export default Home;
